    @Test
    fun toCsv_check_feature_size_from_array() {
        // When
        for (i in 0 until 5) {
            modelData.setLinAcceleration(0F + i, 1F - i, 2F + i)
            modelData.setGyroscope(0.1F - i, 0.2F - i, -0.5F + i)
            modelData.setHistory()
            //modelData.setHistory("2023-03-01_14.57.$i")
        }

        val result = modelData.toArray()
        // Then
        assertEquals(177, result.size)
    }

    @Test
    fun toCsv_check_feature_size() {
